import React, { useState } from "react";
import NavBar from "../common/NavBar";
import PageHeader from "../common/PageHeader";
import { Link } from "react-router-dom";
import { useForm } from "react-hook-form";

export default function MainLayout() {
  let [firstname, setfirstname] = useState("");
  let [lastname, setlastname] = useState("");
  let [email, setemail] = useState("");
  let [phone, setphone] = useState("");
  let [Location, setLocation] = useState("");
  let [DateOfBirth, setDateOfBirth] = useState("");
  let [clientType, setClientType] = useState("Individual");

  const {
    register,
    handleSubmit,
    formState: { errors },
  } = useForm();

  const onSubmit = (data) => {
    console.log(data);
  };
  let menuArray = [true, false, false];
  const [menu, setMenu] = useState(menuArray);
  const [show, setShow] = useState(true);

  // const collectdata = async () => {
  //   if (
  //     !firstname ||
  //     !lastname ||
  //     !email ||
  //     !phone ||
  //     !Location ||
  //     !DateOfBirth
  //   )}
  //   console.log(firstname, lastname, email, phone, Location, DateOfBirth);
  // let info = await fetch("http://localhost:9000", {
  //   method: "post",
  //   body: JSON.stringify({
  //     firstname,
  //     lastname,
  //     email,
  //     phone,
  //     Location,
  //     DateOfBirth,
  //     clientType,
  //   }),
  //   headers: {
  //     "Content-Type": "application/json",
  //   },
  // });
  // info = await info.json();

  const handleClient = (e) => {
    const { name, value } = e.target;

    setClientType(value);
  };

  const setMenuValue = (props) => {
    let newArr = [...menu];
    newArr[props] = !newArr[props];
    setMenu(newArr);
  };

  return (
    <div style={{ display: "flex" }}>
      <div style={{ width: "100%" }}>
        <div className="container " style={{ display: "flex", width: "100%" }}>
          <div className="h-full" style={{ width: "fit-content" }}>
            {/* Remove class [ h-24 ] when adding a card block */}
            {/* Remove class [ border-gray-300  dark:border-gray-700 border-dashed border-2 ] to remove dotted border */}
            <div
              className="rounded border-gray-300  dark:border-gray-700 "
              style={{ width: "100%" }}
            >
              {" "}
              <div className="rounded-r bg-gray-900 xl:hidden flex justify-between  p-6 items-center ">
                <div className="flex justify-between  items-center space-x-3">
                  <svg
                    width={34}
                    height={34}
                    viewBox="0 0 34 34"
                    fill="none"
                    xmlns="http://www.w3.org/2000/svg"
