                        <label
                          for="phone"
                          className="mb-3 text-sm leading-none text-gray-800"
                        >
                          Phone number
                        </label>
                        <input
                          name="phone"
                          id="phone"
                          required
                          type="number"
                          tabIndex={0}
                          aria-label="Enter phone number"
                          className="w-full bg-gray-100 text-sm font-medium leading-none text-gray-800 p-3 border rounded border-gray-200"
                          defaultValue="+81 839274"
                          {...register("phone", {
                            required: "phone is required",
                          })}
                        />
                      </div>
                    </div>
                    <div className="mt-12 md:flex items-center">
                      <div className="flex w-full flex-col">
                        <label
                          for="dateofbirth"
                          className="mb-3 text-sm leading-none text-gray-800"
                        >
                          Date of birth
                        </label>
                        <input
                          name="dateofbirth"
                          id="dateofbirth"
                          required
                          type
                          tabIndex={0}
                          aria-label="Enter date of birth"
                          className="w-full bg-gray-100 text-sm font-medium leading-none text-gray-800 p-3 border rounded border-gray-200"
                          defaultValue="28.03.1997"
                          {...register("dateofbirth", {
                            required: "Date-Of-birth is required",
                          })}
                        />
                      </div>
                      <div className="flex w-full flex-col md:ml-12 md:mt-0 mt-8">
                        <label
                          for="location"
                          className="mb-3 text-sm leading-none text-gray-800"
                        >
                          Location
                        </label>
                        <input
                          name="location"
                          id="location"
                          required
                          type="name"
                          tabIndex={0}
                          aria-label="Enter place of birth"
                          className="w-full bg-gray-100 text-sm font-medium leading-none text-gray-800 p-3 border rounded border-gray-200"
                          defaultValue="San Diego, CA, USA"
                          {...register("location", {
                            required: "location is required",
                          })}
                        />
                      </div>
                    </div>

                    <div className="mt-12 md:flex items-center">
                      <div className="flex w-1/2 flex-col">
                        <select
                          name="client"
                          onChange={handleClient}
                          value={clientType}
                          style={{
                            width: "100%",
                            backgroundColor: "gray ",
                            height: "40px",
                            marginTop: "40px",
                            borderRadius: "4px",
                            padding: "2px 5px",
                            display: "flex",
                          }}
                          {...register(setClientType(), {
                            required: "FirstName is required",
                          })}
                        >
                          <option value="Individual">Individual</option>
                          <option value="Business">Business</option>
                        </select>
                      </div>
                      <div className="flex w-64 flex-col md:ml-12 md:mt-0 mt-8">
                        <button
                          type="submit"
                          value="Submit"
                          role="button"
                          aria-label="Next step"
                          className="flex items-center justify-center py-4 px-7 focus:outline-none bg-white border rounded border-gray-400 mt-7 md:mt-14 hover:bg-gray-100  focus:ring-2 focus:ring-offset-2 focus:ring-gray-700"
                          // onClick={collectdata}
                          onClick={handleSubmit(onSubmit)}
                        >
                          <span className="text-sm font-medium text-center text-gray-800 capitalize">
                            Submit
                          </span>
                          <svg
                            className="mt-1 ml-3"
                            width={12}
                            height={8}
                            viewBox="0 0 12 8"
                            fill="none"
                            xmlns="http://www.w3.org/2000/svg"
                          >
                            <path
                              d="M8.01 3H0V5H8.01V8L12 4L8.01 0V3Z"
                              fill="#242731"
                            />
                          </svg>
                        </button>
                      </div>
                    </div>
                  </form>

